var closeFindUserRule=function(){var selectedRows=$("#userRank_multiselect_to option");if(!selectedRows||selectedRows.length==0){ModalBox.alert("请选择一条数据");return}if($("#findUserRankCallback").val()){var param=new Array();for(var i=0;i<selectedRows.length;i++){var item={value:selectedRows[i].value,name:selectedRows[i].text};param.push(item)}eval($("#findUserRankCallback").val()).call(null,param);$("#findUserRank").modal("hide")}else{}};$(function(){$("#findUserRank").on("show.bs.modal",function(){$("#userRank_multiselect").empty();$("#userRank_multiselect_to").empty();var a=base+"/admin/usercenter/rank/findAll";$.get(a,function(b){$("#userRank_multiselect").empty();if(b.returnObject){var e="";for(var c=0;c<b.returnObject.length;c++){var d=b.returnObject[c];e+="<option value='"+d.code+"'>"+d.label+"</option>"}$("#userRank_multiselect").append(e)}});$("#userRank_multiselect").multiselect()})});